@app.route("/authen/finishAuthenticateByPhoneNumber",methods=["GET"])
def au():
    user_id=request.args.get("userid")
    real_name=request.args.get("name")
    id_card=request.args.get("id_card")
    phone_number=request.args.get("number")
    code=request.args.get("code")
    code=int(code)
    code_au=cache_authen.get(int(user_id))
    response={}
    if code==code_au:
        cache_authen.delete(int(user_id))
        user = IndividualUser.query.filter(IndividualUser.Id == int(user_id)).first()
        user.IsAuthenticated=True
        user.PhoneNumber=int(phone_number)
        user.IDCardNumber=id_card
        user.Name=real_name
        db.session.commit()
        response["success"]=True
        response['message']="实名验证成功！"
        response['content']=None

    else:
        response["success"]=False
        response['message']="请检查验证码是否输入正确！"
        response['content']=None

    return jsonify(response)

